import React from "react";
import Card from "../UI/Card";
import classes from "./AvailableMeals.module.css"
import MealItem from "./MealItems/MealItem";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Malai kofta",
    description: "Malai Kofta is a delicious dish of fried balls of potato and paneer in a rich and creamy mild gravy made with sweet onions and tomatoes.",
    price: 14.99,
  },
  {
    id: "m2",
    name: "Palak Paneer",
    description: "Palak Paneer is one of the most popular Indian dish made with succulent Paneer cubes (Indian cottage cheese) in a smooth spinach sauce",
    price: 12.99,
  },
  {
    id: "m3",
    name: "Paneer bhurji",
    description: "Paneer Bhurji is a popular Indian dish which has scrambled paneer (Indian cottage cheese) cooked with onion, tomatoes and spices",
    price: 16.99,
  },
  {
    id: "m4",
    name: "Paneer Tika masala",
    description: "Paneer Tikka Masala is a flavorful and aromatic curry, made with marinated and grilled paneer cubes simmered in a rich onion tomato gravy along with warm spices",
    price: 17.99,
  },
];

const AvailableMeals = () => {

    const mealsList=DUMMY_MEALS.map((meal) => (
        <MealItem
          key={meal.id}
          id={meal.id}
          name={meal.name}
          description={meal.description}
          price={meal.price}
        />
      ))
  return (
    <Card className={classes.meals}>
      <ul>
        {mealsList}
      </ul>
    </Card>
  );
};
export default AvailableMeals;
